export const Numbers = () => {
    const count = 9;
    const numbers = []
    for (let i = 0; i < count; i++) {
        numbers.push(i + 1)
    }
    return (
        <>
            <h1>numbers</h1>
            {numbers.map(n => <div key={n}> {n}</div>)}
        </>)
}
